// Filter timeline items based on current message filters
function applyFilters() {
    if (!timeline || !items || !groups) return;

    // Get hidden message elements
    const hiddenElements = new Set();
    items.forEach(item => {
        const element = timelineIdToElement.get(item.id);
        if (element && element.classList.contains('filtered-hidden')) {
            hiddenElements.add(element);
        }
    });

    // Determine which groups should be hidden
    const hiddenGroups = new Set();
    const visibleGroups = new Set();

    items.forEach(item => {
        const element = timelineIdToElement.get(item.id);
        if (element) {
            if (element.classList.contains('filtered-hidden')) {
                hiddenGroups.add(item.group);
            } else {
                visibleGroups.add(item.group);
            }
        }
    });

    // Only hide groups that have no visible items
    const groupsToHide = Array.from(hiddenGroups).filter(group => !visibleGroups.has(group));

    // Update timeline groups visibility
    const updatedGroups = groups.map(group => ({
        ...group,
        className: groupsToHide.includes(group.id) ? 'timeline-group-hidden' : ''
    }));

    // Update timeline with filtered items and groups
    timeline.setItems(items.filter(item => !hiddenElements.has(timelineIdToElement.get(item.id))));
    timeline.setGroups(updatedGroups);
}

